import React from "react"
import './App.css';
import Flashcards from "./Flashcard";
import Footer from "./Footer"

import Header from "./Header"

function App(){
  return (
    <div>
      <div className="Background"></div>

      <Header />

      <Flashcards />        

      <footer>
        <Footer />
      </footer>

    </div>
  )
}

export default App;
